import org.apache.spark.mllib.evaluation.{MulticlassMetrics, BinaryClassificationMetrics}
import org.apache.spark.sql.{Dataset, Row, DataFrame}
import org.apache.spark.sql.functions._
import org.apache.spark.sql.types.DoubleType
import org.apache.spark.ml.classification.ClassificationModel
import org.apache.spark.ml.linalg.Vector

object Evaluator {
    def getMetrics(model: ClassificationModel[_, _], dataset: Dataset[_]): (MulticlassMetrics, BinaryClassificationMetrics) = {
        val labelCol = model.getLabelCol
        val predictionCol = model.getPredictionCol
        val rawPredictionCol = model.getRawPredictionCol

        val prediction = model.transform(dataset)

        val scoreAndLabels =
          prediction.select(col(rawPredictionCol), col(labelCol).cast(DoubleType)).rdd.map {
            case Row(rawPrediction: Vector, label: Double) => (rawPrediction(1), label)
            case Row(rawPrediction: Double, label: Double) => (rawPrediction, label)
          }

        val predictionAndLabels =
            prediction.select(col(predictionCol), col(labelCol).cast(DoubleType)).rdd.map {
                case Row(prediction: Double, label: Double) => (prediction, label)
            }

        (new MulticlassMetrics(predictionAndLabels), new BinaryClassificationMetrics(scoreAndLabels))
    }

    def getMetricDF(model: ClassificationModel[_, _], dataset: Dataset[_], name: String = ""): DataFrame = {
        val (mul, bin) = getMetrics(model, dataset)
        val maxF1 = bin.fMeasureByThreshold.map(_._2).collect.sorted.last
        val modelName = if(name.trim.isEmpty) model.toString else name
        val metrics = (modelName, mul.accuracy, mul.fMeasure(1.0), maxF1, mul.precision(1.0), mul.recall(1.0), bin.areaUnderROC, bin.areaUnderPR)

        spark.createDataFrame(Seq(metrics))
            .toDF("name", "accuracy", "f1", "maxF1", "precision", "recall", "auROC", "auPR")
    }

    def getMetricDF(nameAndModelAndDataset: Seq[(String, ClassificationModel[_, _], Dataset[_])]): DataFrame = 
        nameAndModelAndDataset.map(x => getMetricDF(x._2, x._3, x._1))
            .reduce(_ union _)

    def getMetricDF(nameAndModel: Seq[(String, ClassificationModel[_, _])], dataset: Dataset[_]): DataFrame = 
        nameAndModel.map(x => getMetricDF(x._2, dataset, x._1))
            .reduce(_ union _)

    def getCurves(model: ClassificationModel[_, _], dataset: Dataset[_], name: String = ""): (DataFrame, DataFrame) = {
        val (_, bin) = getMetrics(model, dataset)
        val modelName = if(name.trim.isEmpty) model.toString else name
        val roc = bin.roc.toDF("fpr", "tpr").withColumn("name", lit(modelName))
        val pr = bin.pr.toDF("recall", "precision").withColumn("name", lit(modelName))

        (roc, pr)
    }

    def getCurves(nameAndModelAndDataset: Seq[(String, ClassificationModel[_, _], Dataset[_])]): (DataFrame, DataFrame) = {
        nameAndModelAndDataset.map { case (name, model, dataset) =>
            val (_, bin) = getMetrics(model, dataset)
            val modelName = if(name.trim.isEmpty) model.toString else name
            val roc = bin.roc.toDF("fpr", "tpr").withColumn("name", lit(modelName))
            val pr = bin.pr.toDF("recall", "precision").withColumn("name", lit(modelName))

            (roc, pr)
        }.reduce { (a, b) => (a._1 union b._1, a._2 union b._2) }
    }
}
